dataset:
  data_is_long_format: no
  custom_R_code: '
    data %>%
      mutate(
        `Collection Date` = lubridate::parse_date_time(`Collection Date`, orders = "mdy"),
        measurement_remarks = paste0("Collector: ", Collector),
        gm_per_seed = ifelse(!is.na(`Seed/gm`) & `Seed/gm`!= 0, 1/`Seed/gm`, NA),
        location_name = paste0("seeds_collected_at_",`Decimal Latitude`,"_lat_and_",`Decimal Longitude`,"_long"),
        location_name = ifelse(stringr::str_detect(location_name, "NA_lat"), "seeds_collection_location_unknown", location_name)
      ) %>%
      filter(!is.na(`Scientific Name`))'
  collection_date: Collection Date
  taxon_name: Scientific Name
  location_name: location_name
  description: Seed trait data from the WA Seed Centre Kings Park, part of the Botanic
    Gardens and Parks Authority, including seed mass of collected seeds and data on
    germination trials.
  life_stage: adult
  measurement_remarks: measurement_remarks
  sampling_strategy: A key function of the Botanic Gardens and Parks Authority is
    to conserve, manage, display and undertake research into collections of Western
    Australian flora, and to promote the understanding of biodiversity. The WA Seed
    Centre Kings Park is located in the Biodiversity Conservation Centre in Kings
    Park and Botanic Garden and has been involved in the collection, storage and testing
    of Western Australian native plant seed for over 40 years. Seeds from over 3500
    different plant species are stored in the seedbank and maintained to International
    Standards.
  original_file: Data downloaded from https://seedbank.ala.org.au on 19 Feb 2025.
    Data downloaded by Order, for all vascular plants.
  notes: none
identifiers:
